import { Link } from 'react-router-dom';

const EVENTS = [
	{ id: '1', event: 'my event' },
	{ id: '21', event: 'my event' },
	{ id: '3', event: 'my event' },
	{ id: '4', event: 'my event' },
	{ id: '5', event: 'my event' },
];

export const EventPage = () => {
	return (
		<>
			<h1>EventPage</h1>
			<ul>
				{EVENTS.map(event => (
					<li key={event.id}>
						<Link to={event.id}>{event.eve}</Link>
					</li>
				))}
			</ul>
		</>
	);
};
